import React from "react";
import "./Home.css";

const Home = () => {
    return (
        <div className="home">
            <div className="person__section">
                <h1>Hay, I am Anvit</h1>
                <p>An architect, softaware developer, Youtuber and keynote speaker. On this <br /> site i write about my learning and experience</p>
            </div>
        </div>
    )
}

export default Home;
